def predict_transaction(model, input_data):
    input_df = pd.DataFrame([input_data])

    # Convert and extract datetime features
    input_df['Timestamp'] = pd.to_datetime(input_df['Timestamp'])
    input_df['Hour'] = input_df['Timestamp'].dt.hour
    input_df['Day'] = input_df['Timestamp'].dt.day
    input_df['Month'] = input_df['Timestamp'].dt.month
    input_df['DayOfWeek'] = input_df['Timestamp'].dt.dayofweek
    input_df = input_df.drop(['Transaction_ID', 'User_ID', 'Timestamp'], axis=1)

    # Encode categorical columns safely
    for col in categorical_columns:
        le = label_encoders[col]
        if input_df[col].iloc[0] not in le.classes_:
            le.classes_ = np.append(le.classes_, input_df[col].iloc[0])
        input_df[col] = le.transform(input_df[col].astype(str))

    prediction = model.predict(input_df)
    return "Fraudulent Transaction " if prediction[0] == 1 else "Legitimate Transaction "

